import React, { Fragment } from "react";
import { Form, Input, Button, Row, Col, InputNumber, DatePicker } from "antd";

const layout = {
  labelCol: { span: 3 },
  wrapperCol: { span: 16 }
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 }
};

const CusomizedForm = ({
  firsItem,
  secondItem,
  thirdItem,
  fourthItem,
  fiveItem,
  sixItem,
  sevenItem,
  eightItem,
  nineItem,
  tenItem,
  elevenItem,
  onClose,
  onhandleAdd
}) => {
  return (
    <Fragment>
      <Form
        name="basic"
        onFinish={onhandleAdd}
        hideRequiredMark
        className="m-0"
      >
        <Form.Item
          label={firsItem}
          name={firsItem}
          rules={[{ required: true, message: `Please input ${firsItem}` }]}
        >
          <Input allowClear />
        </Form.Item>

        <Form.Item
          label={secondItem}
          name={secondItem}
          rules={[{ required: true, message: `Please input ${secondItem}` }]}
        >
          <InputNumber
            min={0}
            step={0.1}
            formatter={secondItem => `¥ ${secondItem}`}
            className="w-100"
          />
        </Form.Item>
        <Form.Item
          label={thirdItem}
          name={thirdItem}
          rules={[{ required: true, message: `Please input ${thirdItem}` }]}
        >
          <Input allowClear />
        </Form.Item>
        <Form.Item
          label={fourthItem}
          name={fourthItem}
          rules={[{ required: true, message: `Please input ${fourthItem}` }]}
        >
          <DatePicker className="w-100" />
        </Form.Item>

        <Row>
          <Col span={5}>
            <Form.Item {...tailLayout}>
              <Button type="primary" htmlType="submit">
                Add
              </Button>
            </Form.Item>
          </Col>
          <Col span={5}>
            <Form.Item {...tailLayout}>
              <Button type="danger" onClick={onClose}>
                Cancel
              </Button>
            </Form.Item>
          </Col>
        </Row>
      </Form>
    </Fragment>
  );
};
export default CusomizedForm;
